import React, { useRef } from 'react';
// motion
import { motion } from "framer-motion";
// variants
import { fadeIn } from "../variants";
// Import emailjs
import emailjs from '@emailjs/browser';


const Contact = () => {
    // Form reference
    const form = useRef();

    // Function to send email
    const sendEmail = (e) => {
        e.preventDefault();

        emailjs.sendForm('service_6w5bvdh', 'template_epp41tf', form.current, 'h7xiNrW-pTzv7e_3G')
            .then((result) => {
                console.log(result.text);
                // Clear the form or show a success message
            }, (error) => {
                console.log(error.text);
                // Handle errors here
            });
        e.target.reset(); // Optional: Reset the form after submission
    };

    return (
        <section id='contact' className='py-16 lg:section h-screen'>
            <div className='container mx-auto'>
                <div className='flex flex-col lg:flex-row'>
                    {/* text */}
                    <motion.div
                        variants={fadeIn('right', 0.3)}
                        initial="hidden"
                        whileInView={"show"}
                        viewport={{once: false, amount: 0.3}}
                        className='flex-1 flex justify-start items-center'>
                        <div>
                            <h4 className='text-xl uppercase text-accent font-medium mb-2 tracking-wide'>
                                Get in touch
                            </h4>
                            <h2 className='text-[45px] lg:text-[90px] leading-none mb-12'>
                                Let's work together!
                            </h2>
                        </div>
                    </motion.div>
                    {/* form */}
                    <motion.for
                        ref={form}
                        onSubmit={sendEmail}
                        variants={fadeIn('left', 0.3)}
                        initial="hidden"
                        whileInView={"show"}
                        viewport={{once: false, amount: 0.3}}
                        className='flex-1 border rounded-2xl flex flex-col gap-y-6 pb-24 p-6 items-start'>
                        <input
                            className='bg-transparent border-b py-3 outline-none w-full placeholder:text-white focus:border-accent transition-all'
                            type='text'
                            name='user_name'
                            placeholder='Your name'
                        />
                        <input
                            className='bg-transparent border-b py-3 outline-none w-full placeholder:text-white focus:border-accent transition-all'
                            type='email'
                            name='user_email'
                            placeholder='Your e-mail'
                        />
                        <textarea
                            className='bg-transparent border-b py-3 outline-none w-full placeholder:text-white focus:border-accent transition-all resize-none mb-12'
                            name='message'
                            placeholder='Your message'
                        />
                        <form id="form">
                            <div className="field">
                                <label htmlFor="from_name">from_name</label>
                                <input type="text" name="from_name" id="from_name"/>
                            </div>
                            <div className="field">
                                <label htmlFor="to_name">to_name</label>
                                <input type="text" name="to_name" id="to_name"/>
                            </div>
                            <div className="field">
                                <label htmlFor="message">message</label>
                                <input type="text" name="message" id="message"/>
                            </div>
                            <div className="field">
                                <label for="reply_to">reply_to</label>
                                <input type="text" name="reply_to" id="reply_to"/>
                            </div>

                            <input type="submit" id="button" value="Send Email" />
                        </form>

                        <script type="text/javascript"
                                src="https://cdn.jsdelivr.net/npm/@emailjs/browser@4/dist/email.min.js"></script>

                        <script type="text/javascript">
                            emailjs.init('h7xiNrW-pTzv7e_3G')
                        </script>
                        <button type='submit' className='btn btn-lg'>Send message</button>
                    </motion.for>
                </div>
            </div>
        </section>
    );
};
export default Contact;
